func TestBigQuery_Integration(t *testing.T) {
	if os.Getenv("BIGQUERY_INTEGRATION") != "true" {
		//t.Skip("BIGQUERY_INTEGRATION not set to true")
	}
	godotenv.Load("../.env")

	ctx := context.Background()
	l := zaptest.NewLogger(t)
	cfg := config.NewEnvConfig()
	cfg.BigQuery.MatchesTableID = "matches_integration_test"
	bqs, err := NewHybridBigQueryStore(ctx, l, BigQueryOpts{
		ProjectID: cfg.GCPProjectID,
		ConnOpts:  cfg.GCPConnOpts(),
		DataOpts:  cfg.BigQuery,
	}, GitHubStoreOpts{
		Auth: cfg.GitHubAPITokenSource(), Repo: cfg.GitHubStoreRepo,
	})
	require.NoError(t, err)

	var match1, match2 riot.MatchDetails
	require.NoError(t, json.Unmarshal([]byte(testMatch1), &match1))
	require.NoError(t, json.Unmarshal([]byte(testMatch2), &match2))

	require.NoError(t, bqs.Add(ctx, "integration-test", Matches{{&match1}, {&match2}}))
}

